import React, {PureComponent} from 'react'
import './shoppingBasket.scss';

export default class ShoppingBasket extends PureComponent {
  render() {
    return (
      <ThemeContextConsumer>
        {context => (
          <a>Корзина:
            <span>{`${context.value}`}</span>
          </a>
        )}
      </ThemeContextConsumer>
    )
  }
}
